package com.soldesk.Sollind.company;

import java.math.BigDecimal;

public class Company {
	private BigDecimal c_no;
	private String c_name;
	private String c_cate;
	private String c_size;
	private String c_people;
	private String c_open;
	private String c_addr;
	private String c_homepage;
	private String c_asset;
	private BigDecimal c_count;
	private BigDecimal c_score;
	private String c_logo;
	
	public Company() {
		// TODO Auto-generated constructor stub
	}

	public BigDecimal getC_no() {
		return c_no;
	}

	public void setC_no(BigDecimal c_no) {
		this.c_no = c_no;
	}

	public String getC_name() {
		return c_name;
	}

	public void setC_name(String c_name) {
		this.c_name = c_name;
	}

	public String getC_cate() {
		return c_cate;
	}

	public void setC_cate(String c_cate) {
		this.c_cate = c_cate;
	}

	public String getC_size() {
		return c_size;
	}

	public void setC_size(String c_size) {
		this.c_size = c_size;
	}

	public String getC_people() {
		return c_people;
	}

	public void setC_people(String c_people) {
		this.c_people = c_people;
	}

	public String getC_open() {
		return c_open;
	}

	public void setC_open(String c_open) {
		this.c_open = c_open;
	}

	public String getC_addr() {
		return c_addr;
	}

	public void setC_addr(String c_addr) {
		this.c_addr = c_addr;
	}

	public String getC_homepage() {
		return c_homepage;
	}

	public void setC_homepage(String c_homepage) {
		this.c_homepage = c_homepage;
	}

	public String getC_asset() {
		return c_asset;
	}

	public void setC_asset(String c_asset) {
		this.c_asset = c_asset;
	}

	public BigDecimal getC_count() {
		return c_count;
	}

	public void setC_count(BigDecimal c_count) {
		this.c_count = c_count;
	}

	public BigDecimal getC_score() {
		return c_score;
	}

	public void setC_score(BigDecimal c_score) {
		this.c_score = c_score;
	}

	public String getC_logo() {
		return c_logo;
	}

	public void setC_logo(String c_logo) {
		this.c_logo = c_logo;
	}
	
	
}
